import selfs from './selfs' ;
import zeros from './zeros' ;

export default function _RankedTreeUniverse ( union , find ) {

	const Universe = function ( n , List = Array ) {
		this.p = selfs( n , List ) ;
		this.r = zeros( n , List ) ;
	} ;

	Universe.prototype.union = function ( a , b ) {
		return union( this.p , this.r , a , b ) ;
	} ;

	Universe.prototype.find = function ( x ) {
		return find( this.p , x ) ;
	} ;

	return Universe ;

}

export default function nulls ( n , List = Array ) {

	const a = new List( n ) ;

	for ( let i = 0 ; i < n ; ++i ) a[i] = -1 ;

	return a ;

}

export default function ones ( n , List = Array ) {

	const a = new List( n ) ;

	for ( let i = 0 ; i < n ; ++i ) a[i] = 1 ;

	return a ;

}

export default function rankedtreeunion ( p , r , a , b ) {

	if ( r[a] < r[b] ) {
		p[a] = b ;
		return b ;
	}

	else if ( r[a] > r[b] ) {
		p[b] = a ;
		return a ;
	}

	else {
		p[b] = a ;
		++r[a] ;
		return a ;
	}

}

export default function selfs ( n , List = Array ) {

	const a = new List( n ) ;

	for ( let i = 0 ; i < n ; ++i ) a[i] = i ;

	return a ;

}

export default function zeros ( n , List = Array ) {

	const a = new List( n ) ;

	for ( let i = 0 ; i < n ; ++i ) a[i] = 0 ;

	return a ;

}
